package leetcode.medium;

import leetcode.TreeNode;

import java.util.Map;
import java.util.TreeMap;

/**
 * 2196. Create Binary Tree From Descriptions
 * Medium
 *
 * 396
 *
 * 10
 *
 * Add to List
 *
 * Share
 * You are given a 2D integer array descriptions where descriptions[i] = [parenti, childi, isLefti] indicates that parenti is the parent of childi in a binary tree of unique values. Furthermore,
 *
 * If isLefti == 1, then childi is the left child of parenti.
 * If isLefti == 0, then childi is the right child of parenti.
 * Construct the binary tree described by descriptions and return its root.
 *
 * The test cases will be generated such that the binary tree is valid.
 *
 *
 *
 * Example 1:
 *
 *
 * Input: descriptions = [[20,15,1],[20,17,0],[50,20,1],[50,80,0],[80,19,1]]
 * Output: [50,20,80,15,17,19]
 * Explanation: The root node is the node with value 50 since it has no parent.
 * The resulting binary tree is shown in the diagram.
 * Example 2:
 *
 *
 * Input: descriptions = [[1,2,1],[2,3,0],[3,4,1]]
 * Output: [1,2,null,null,3,4]
 * Explanation: The root node is the node with value 1 since it has no parent.
 * The resulting binary tree is shown in the diagram.
 *
 *
 * Constraints:
 *
 * 1 <= descriptions.length <= 104
 * descriptions[i].length == 3
 * 1 <= parenti, childi <= 105
 * 0 <= isLefti <= 1
 * The binary tree described by descriptions is valid.
 * Accepted
 * 16,040
 * Submissions
 * 22,692
 *
 * Success
 * Details
 * Runtime: 447 ms, faster than 5.03% of Java online submissions for Create Binary Tree From Descriptions.
 * Memory Usage: 119.4 MB, less than 39.66% of Java online submissions for Create Binary Tree From Descriptions.
 * Next challenges:
 * Convert Sorted List to Binary Search Tree
 * Number Of Ways To Reconstruct A Tree
 */
public class _2196_BT_CreateFromDescriptions {
    /**
     * Definition for a binary tree node.
     * public class TreeNode {
     *     int val;
     *     TreeNode left;
     *     TreeNode right;
     *     TreeNode() {}
     *     TreeNode(int val) { this.val = val; }
     *     TreeNode(int val, TreeNode left, TreeNode right) {
     *         this.val = val;
     *         this.left = left;
     *         this.right = right;
     *     }
     * }
     */
    class Solution {

        private final Map<Integer, TreeNode> nodeMap = new TreeMap<>();

        public TreeNode createBinaryTree(int[][] descriptions) {
            if (descriptions == null || descriptions.length < 1) {
                return null;
            }

            for (int[] data : descriptions) {
                TreeNode node = nodeMap.getOrDefault(data[0], new TreeNode(data[0]));
                TreeNode child = nodeMap.getOrDefault(data[1], new TreeNode(data[1]));

                if (data[2] == 1) {
                    node.left = child;
                } else {
                    node.right = child;
                }
                nodeMap.put(node.val, node);
                nodeMap.put(child.val, child);
            }

            for(int[] data : descriptions) {
                nodeMap.remove(data[1]);
            }

            if (nodeMap.size() == 1) {
                return nodeMap.values().iterator().next();
            }
            return null;
        }

    }
}

